// ==UserScript==
// @name         wachtrij
// @version      2.2.0
// @description  shows troops in queue for all cities
// @author       Miro
// @include      https://*.grepolis.com/game/*
// @grant        none
// @namespace https://greasyfork.org/users/984383
// @downloadURL https://update.greasyfork.org/scripts/477181/wachtrij.user.js
// @updateURL https://update.greasyfork.org/scripts/477181/wachtrij.meta.js
// ==/UserScript==

(async function () {

    // wait for page to load
    const sleep = (n) => new Promise((res) => setTimeout(res, n));
    await sleep(1500)

    let unitlist = {};
  
    function get_units() {
      var units = {}
      var list = []
      for (const order of Object.values(MM.getModels().UnitOrder)) {
        if (!units[order.getUnitId()]) {
          units[order.getUnitId()] = 0
        }
  
        units[order.getUnitId()] += order.getCount()
      }
      
      for (const [key, val] of Object.entries(units)) {
        list.push(`${key}: ${val}`)
      }
      return list;
    }
  
    function create_window() {
      try {
        unitlist = get_units();
      }
      catch {
        console.log("No troops in queue")
      }
      GPWindowMgr.Create(GPWindowMgr.TYPE_DIALOG, "wachtrij");
      var window = GPWindowMgr.getOpenFirst(GPWindowMgr.TYPE_DIALOG);
      window.setPosition(['center', 'center']);
      window.setSize(300, 500);
      if (unitlist.length == 0) {
        unitlist.push("Geen troepen in de wachtrij");
      }
        window.setContent2(unitlist.join("<br>"));
    }

    function add_main_button( ){
      if (document.getElementById('wachtrijMainButton') == null) {
        var a = document.createElement('div');
        a.id = "wachtrijMainButton";
        a.className = 'btn_settings circle_button';
        var img = document.createElement('div');
        img.style.margin = '6px 0px 0px 5px';
        img.style.background = "url('data:image/png;base64,') no-repeat 0px 0px";
        img.style.width = '22px';
        img.style.height = '22px';
        img.style.backgroundSize = '100%';
        a.style.top = '140px';
        a.style.right = '110px';
        a.style.zIndex = '10000';
        a.appendChild(img);
        document.getElementById('ui_box').appendChild(a);
        $("#wachtrijMainButton").click(create_window);
      }
    }
  
    function add_button() {
      if (document.getElementById('wachtrijButton') == null) {
        var a = document.createElement('div');
        a.id = "wachtrijButton";
        a.className = 'button_new square .';
        var img = document.createElement('div');
        img.style.background = "url('data:image/png;base64,') no-repeat 0px 0px";
        img.style.width = '20px';
        img.style.height = '21px';
        img.style.backgroundSize = '100%';
        img.style.display = 'block';
        a.appendChild(img);
        try {
            document.getElementById('recruit_control').insertBefore(a, document.getElementById('btn_recruit_help'));
            clearInterval(wachtrijinterval);
        } catch (err) {} // recruit window is not open
        $("#wachtrijButton").click(add_main_button);
      }
    }
  
    let wachtrijinterval = setInterval(add_button, 200);

    add_main_button();
  })();